import React, { useState } from 'react';

function PropertyForm() {
  // State variables for form fields
  const [currentMarketValue, setCurrentMarketValue] = useState('');
  const [carpetArea, setCarpetArea] = useState('');
  const [pincode, setPincode] = useState('');
  const [buildingAge, setBuildingAge] = useState('');
  const [propertyEffect, setPropertyEffect] = useState(false);

  // State variables for security measures
  const [security24x7, setSecurity24x7] = useState(false);
  const [isSalaried, setIsSalaried] = useState(false);

  // Proceed button click handler
  const handleProceed = () => {
    // You can perform further actions or validations here
    console.log('Form submitted:', {
      currentMarketValue,
      carpetArea,
      pincode,
      buildingAge,
      propertyEffect,
      security24x7,
      isSalaried,
    });
  };

  return (
    <div>
      <h2>Structure Details</h2>

      {/* Form for structure details */}
      <form>
        <div>
          <label>Current Market Value of Property: </label>
          <input type="text" value={currentMarketValue} onChange={(e) => setCurrentMarketValue(e.target.value)} />
        </div>

        <div>
          <label>Carpet Area/sq.ft: </label>
          <input type="text" value={carpetArea} onChange={(e) => setCarpetArea(e.target.value)} />
        </div>

        <div>
          <label>Enter Pincode: </label>
          <input type="text" value={pincode} onChange={(e) => setPincode(e.target.value)} />
        </div>

        <div>
          <label>Age of Building: </label>
          <div>
            {[0, 5, 10, 15, 20, 25].map((years) => (
              <label key={years}>
                <input
                  type="radio"
                  value={years}
                  checked={buildingAge === years}
                  onChange={() => setBuildingAge(years)}
                />
                {`${years}-${years + 5} years`}
              </label>
            ))}
          </div>
        </div>

        <div>
          <label>Has your property been affected by floods/earthquake in the past 5 years: </label>
          <input
            type="range"
            min="0"
            max="1"
            step="1"
            value={propertyEffect ? "1" : "0"}
            onChange={(e) => setPropertyEffect(e.target.value === "1")}
          />
          {propertyEffect ? "Yes" : "No"}
        </div>
      </form>

      <h2>Security Measures</h2>

      {/* Form for security measures */}
      <form>
        <div>
          <label>24*7 Security: </label>
          <input
            type="range"
            min="0"
            max="1"
            step="1"
            value={security24x7 ? "1" : "0"}
            onChange={(e) => setSecurity24x7(e.target.value === "1")}
          />
          {security24x7 ? "Yes" : "No"}
        </div>

        <div>
          <label>Are you a salaried individual?: </label>
          <input
            type="range"
            min="0"
            max="1"
            step="1"
            value={isSalaried ? "1" : "0"}
            onChange={(e) => setIsSalaried(e.target.value === "1")}
          />
          {isSalaried ? "Yes" : "No"}
        </div>
      </form>

      {/* Proceed button */}
      <button onClick={handleProceed}>Proceed</button>
    </div>
  );
}

export default PropertyForm;
